insert into `article` (`id`, `title`, `tag`, `content`, `created`, `profile`, `cover`) values('2','日常后端文章','后端文章','<p><img alt=\"a.jpg\" src=\"data:image/jpeg;base64,\" width=\"640\" height=\"640\"></p><p><b>发祈福祈福方法</b><br></p>','2020-05-20 20:28:39','后端跨域实现','data:image/jpeg;base64,');
insert into `article` (`id`, `title`, `tag`, `content`, `created`, `profile`, `cover`) values('6','后端实现导出Excel表格','后端','<h3><img alt=\"动漫1.jpg\" src=\"data:image/jpeg;base64,\" width=\"700\" height=\"437.5\"><br></h3><h3>1.导入依赖，注意如果项目使用了内嵌的tomcat容器，需要排除servlet-api<br></h3><pre><code><span style=\"color:#e8bf6a;\">&lt;dependency&gt;<br></span><span style=\"color:#e8bf6a;\">    &lt;groupId&gt;</span>org.apache.poi<span style=\"color:#e8bf6a;\">&lt;/groupId&gt;<br></span><span style=\"color:#e8bf6a;\">    &lt;artifactId&gt;</span>poi<span style=\"color:#e8bf6a;\">&lt;/artifactId&gt;<br></span><span style=\"color:#e8bf6a;\">    &lt;version&gt;</span>3.6<span style=\"color:#e8bf6a;\">&lt;/version&gt;<br></span><span style=\"color:#e8bf6a;\">    &lt;exclusions&gt;<br></span><span style=\"color:#e8bf6a;\">        </span><span style=\"color:#808080;\">&lt;!-- </span><span style=\"color:#808080;font-family:\'Arial\';\">排除</span><span style=\"color:#808080;\"> servlet-api </span><span style=\"color:#808080;font-family:\'Arial\';\">否则会报错 </span><span style=\"color:#808080;\">--&gt;<br></span><span style=\"color:#808080;\">        </span><span style=\"color:#e8bf6a;\">&lt;exclusion&gt;<br></span><span style=\"color:#e8bf6a;\">            &lt;groupId&gt;</span>javax.servlet<span style=\"color:#e8bf6a;\">&lt;/groupId&gt;<br></span><span style=\"color:#e8bf6a;\">            &lt;artifactId&gt;</span>servlet-api<span style=\"color:#e8bf6a;\">&lt;/artifactId&gt;<br></span><span style=\"color:#e8bf6a;\">        &lt;/exclusion&gt;<br></span><span style=\"color:#e8bf6a;\">    &lt;/exclusions&gt;<br></span><span style=\"color:#e8bf6a;\">&lt;/dependency&gt;</span></code></pre><h3>2.实体类，持久层和业务层代码省略</h3><h3>3.编写ExcelUtils工具类</h3><pre><code><span style=\"color:#cc7832;\">import </span>org.apache.poi.hssf.usermodel.*<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">import </span>javax.servlet.http.HttpServletResponse<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">import </span>java.io.UnsupportedEncodingException<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">public class </span>ExcelUtils {<br>    <span style=\"color:#629755;font-style:italic;\">/**<br></span><span style=\"color:#629755;font-style:italic;\">     * </span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">导出</span><span style=\"color:#629755;font-style:italic;\">Excel<br></span><span style=\"color:#629755;font-style:italic;\">     * </span><span style=\"color:#629755;font-weight:bold;font-style:italic;\">@param </span><span style=\"color:#8a653b;font-style:italic;\">sheetName </span><span style=\"color:#629755;font-style:italic;\">sheet</span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">名称<br></span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">     </span><span style=\"color:#629755;font-style:italic;\">* </span><span style=\"color:#629755;font-weight:bold;font-style:italic;\">@param </span><span style=\"color:#8a653b;font-style:italic;\">title </span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">标题<br></span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">     </span><span style=\"color:#629755;font-style:italic;\">* </span><span style=\"color:#629755;font-weight:bold;font-style:italic;\">@param </span><span style=\"color:#8a653b;font-style:italic;\">values </span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">内容<br></span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">     </span><span style=\"color:#629755;font-style:italic;\">* </span><span style=\"color:#629755;font-weight:bold;font-style:italic;\">@param </span><span style=\"color:#8a653b;font-style:italic;\">wb </span><span style=\"color:#629755;font-style:italic;\">HSSFWorkbook</span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">对象<br></span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">     </span><span style=\"color:#629755;font-style:italic;\">*/<br></span><span style=\"color:#629755;font-style:italic;\">    </span><span style=\"color:#cc7832;\">public static </span>HSSFWorkbook <span style=\"color:#ffc66d;\">getHSSFWorkbook</span>(String sheetName<span style=\"color:#cc7832;\">, </span>String []title<span style=\"color:#cc7832;\">, </span>String [][]values<span style=\"color:#cc7832;\">, </span>HSSFWorkbook wb){<br><br>        <span style=\"color:#808080;\">// </span><span style=\"color:#808080;font-family:\'Arial\';\">第一步，创建一个</span><span style=\"color:#808080;\">HSSFWorkbook</span><span style=\"color:#808080;font-family:\'Arial\';\">，对应一个</span><span style=\"color:#808080;\">Excel</span><span style=\"color:#808080;font-family:\'Arial\';\">文件<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span><span style=\"color:#cc7832;\">if</span>(wb == <span style=\"color:#cc7832;\">null</span>){<br>            wb = <span style=\"color:#cc7832;\">new </span>HSSFWorkbook()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>}<br><br>        <span style=\"color:#808080;\">// </span><span style=\"color:#808080;font-family:\'Arial\';\">第二步，在</span><span style=\"color:#808080;\">workbook</span><span style=\"color:#808080;font-family:\'Arial\';\">中添加一个</span><span style=\"color:#808080;\">sheet,</span><span style=\"color:#808080;font-family:\'Arial\';\">对应</span><span style=\"color:#808080;\">Excel</span><span style=\"color:#808080;font-family:\'Arial\';\">文件中的</span><span style=\"color:#808080;\">sheet<br></span><span style=\"color:#808080;\">        </span>HSSFSheet sheet = wb.createSheet(sheetName)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">// </span><span style=\"color:#808080;font-family:\'Arial\';\">第三步，在</span><span style=\"color:#808080;\">sheet</span><span style=\"color:#808080;font-family:\'Arial\';\">中添加表头第</span><span style=\"color:#808080;\">0</span><span style=\"color:#808080;font-family:\'Arial\';\">行</span><span style=\"color:#808080;\">,</span><span style=\"color:#808080;font-family:\'Arial\';\">注意老版本</span><span style=\"color:#808080;\">poi</span><span style=\"color:#808080;font-family:\'Arial\';\">对</span><span style=\"color:#808080;\">Excel</span><span style=\"color:#808080;font-family:\'Arial\';\">的行数列数有限制<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>HSSFRow row = sheet.createRow(<span style=\"color:#6897bb;\">0</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">// </span><span style=\"color:#808080;font-family:\'Arial\';\">第四步，创建单元格，并设置值表头 设置表头居中<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>HSSFCellStyle style = wb.createCellStyle()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>style.setAlignment(HSSFCellStyle.ALIGN_CENTER)<span style=\"color:#cc7832;\">; </span><span style=\"color:#808080;\">// </span><span style=\"color:#808080;font-family:\'Arial\';\">创建一个居中格式<br></span><span style=\"color:#808080;font-family:\'Arial\';\"><br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span><span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">声明列对象<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>HSSFCell cell = <span style=\"color:#cc7832;\">null;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">创建标题<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span><span style=\"color:#cc7832;\">for</span>(<span style=\"color:#cc7832;\">int </span>i=<span style=\"color:#6897bb;\">0</span><span style=\"color:#cc7832;\">;</span>i&lt;title.<span style=\"color:#9876aa;\">length</span><span style=\"color:#cc7832;\">;</span>i++){<br>            cell = row.createCell(i)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>cell.setCellValue(title[i])<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>cell.setCellStyle(style)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>}<br><br>        <span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">创建内容<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span><span style=\"color:#cc7832;\">for</span>(<span style=\"color:#cc7832;\">int </span>i=<span style=\"color:#6897bb;\">0</span><span style=\"color:#cc7832;\">;</span>i&lt;values.<span style=\"color:#9876aa;\">length</span><span style=\"color:#cc7832;\">;</span>i++){<br>            row = sheet.createRow(i + <span style=\"color:#6897bb;\">1</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            for</span>(<span style=\"color:#cc7832;\">int </span>j=<span style=\"color:#6897bb;\">0</span><span style=\"color:#cc7832;\">;</span>j&lt;values[i].<span style=\"color:#9876aa;\">length</span><span style=\"color:#cc7832;\">;</span>j++){<br>                <span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">将内容按顺序赋给对应的列对象<br></span><span style=\"color:#808080;font-family:\'Arial\';\">                </span>row.createCell(j).setCellValue(values[i][j])<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>}<br>        }<br>        <span style=\"color:#cc7832;\">return </span>wb<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">    </span>}<br><br>    <span style=\"color:#629755;font-style:italic;\">/**<br></span><span style=\"color:#629755;font-style:italic;\">     * </span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">发送响应流方法<br></span><span style=\"color:#629755;font-style:italic;font-family:\'Courier New\';\">     </span><span style=\"color:#629755;font-style:italic;\">*/<br></span><span style=\"color:#629755;font-style:italic;\">    </span><span style=\"color:#cc7832;\">public  static void </span><span style=\"color:#ffc66d;\">setResponseHeader</span>(HttpServletResponse response<span style=\"color:#cc7832;\">, </span>String fileName) {<br>        <span style=\"color:#cc7832;\">try </span>{<br>            <span style=\"color:#cc7832;\">try </span>{<br>                fileName = <span style=\"color:#cc7832;\">new </span>String(fileName.getBytes()<span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"ISO8859-1\"</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>} <span style=\"color:#cc7832;\">catch </span>(UnsupportedEncodingException e) {<br>                <span style=\"color:#808080;\">// </span><span style=\"color:#a8c023;font-style:italic;\">TODO Auto-generated catch block<br></span><span style=\"color:#a8c023;font-style:italic;\">                </span>e.printStackTrace()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>}<br>            response.setContentType(<span style=\"color:#6a8759;\">\"application/octet-stream;charset=ISO8859-1\"</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>response.setHeader(<span style=\"color:#6a8759;\">\"Content-Disposition\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"attachment;filename=\" </span>+ fileName)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>response.addHeader(<span style=\"color:#6a8759;\">\"Pargam\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"no-cache\"</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">            </span>response.addHeader(<span style=\"color:#6a8759;\">\"Cache-Control\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"no-cache\"</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>} <span style=\"color:#cc7832;\">catch </span>(Exception ex) {<br>            ex.printStackTrace()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>}<br>    }<br>}\n\n</code></pre><h2>3.测试</h2><pre><code><br><span style=\"color:#bbb529;\">@RequestMapping</span>(<span style=\"color:#d0d0ff;\">value </span>= <span style=\"color:#6a8759;\">\"/exportClient\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#d0d0ff;\">method </span>= RequestMethod.<span style=\"color:#9876aa;font-style:italic;\">GET</span>)<br><span style=\"color:#cc7832;\">public void </span>export(HttpServletRequest request<span style=\"color:#cc7832;\">, </span>HttpServletResponse response) <span style=\"color:#cc7832;\">throws </span>Exception {<br>        <span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">获取数据<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>List&lt;<span style=\"color:#507874;\">Client</span>&gt; clients = clientService.getAllClient()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">//excel</span><span style=\"color:#808080;font-family:\'Arial\';\">标题<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>String[] title = {<span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">顾客编号</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">姓名</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">性别</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">, </span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">地址</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">电话</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">症状</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">经办人</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">时间</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">,</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">备注</span><span style=\"color:#6a8759;\">\"</span>}<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">//excel</span><span style=\"color:#808080;font-family:\'Arial\';\">文件名<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>String fileName = <span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">顾客信息表</span><span style=\"color:#6a8759;\">\" </span>+ System.currentTimeMillis() + <span style=\"color:#6a8759;\">\".xls\"</span><span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">//sheet</span><span style=\"color:#808080;font-family:\'Arial\';\">名<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span>String sheetName = <span style=\"color:#6a8759;\">\"</span><span style=\"color:#6a8759;font-family:\'Arial\';\">顾客信息表</span><span style=\"color:#6a8759;\">\"</span><span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span>String [][] content = <span style=\"color:#cc7832;\">new </span>String[clients.size()][<span style=\"color:#6897bb;\">9</span>]<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        for </span>(<span style=\"color:#cc7832;\">int </span>i = <span style=\"color:#6897bb;\">0</span><span style=\"color:#cc7832;\">; </span>i &lt; <span style=\"color:#507874;\">clients</span>.size()<span style=\"color:#cc7832;\">; </span>i++) {<br>        content[i] = <span style=\"color:#cc7832;\">new </span>String[title.length]<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>Client obj = clients.get(i)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">0</span>] = obj.getCno()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">1</span>] = obj.getCname()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">2</span>] = obj.getCsex()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">3</span>] = obj.getCaddress()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">4</span>] = obj.getCphone()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">5</span>] = obj.getCsymptom()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">6</span>] = obj.getAno()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">7</span>] = obj.getCdate().toString()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>content[i][<span style=\"color:#6897bb;\">8</span>] = obj.getCremark()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>}<br><br>        <span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">创建</span><span style=\"color:#808080;\">HSSFWorkbook<br></span><span style=\"color:#808080;\">        </span>HSSFWorkbook wb = ExcelUtils.getHSSFWorkbook(sheetName<span style=\"color:#cc7832;\">, </span>title<span style=\"color:#cc7832;\">, </span>content<span style=\"color:#cc7832;\">, null</span>)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\"><br></span><span style=\"color:#cc7832;\">        </span><span style=\"color:#808080;\">//</span><span style=\"color:#808080;font-family:\'Arial\';\">响应到客户端<br></span><span style=\"color:#808080;font-family:\'Arial\';\">        </span><span style=\"color:#cc7832;\">try </span>{<br>        ExcelUtils.setResponseHeader(response<span style=\"color:#cc7832;\">, </span>fileName)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>OutputStream os = response.getOutputStream()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>wb.write(os)<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>os.flush()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>os.close()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>} <span style=\"color:#cc7832;\">catch </span>(Exception e) {<br>        e.printStackTrace()<span style=\"color:#cc7832;\">;<br></span><span style=\"color:#cc7832;\">        </span>}<br>        }</code></pre><h3>4.客户端发送请求就会下载Excel文件</h3>','2020-05-20 22:28:35','导出Excel表格在后台管理系统中被经常使用到','data:image/jpeg;base64,');

